import './Home.css';

const home =props => (
    
    <body>
        <div className>
            <h3>The Most Epic Text Ever Written</h3>
            <div className="line"></div>
            <h4>The medium length sentence that will give you goosebumps</h4>
        </div>
    </body>


);

export default home;
